// Function to pass search value back up via state.
function Search({search}) {

  return (
    <form>
      <input
        style={{marginLeft: "740px"}}
        type="text"
        placeholder="Search Products"
        onChange={(e) => search(e.target.value)}
      /> 
    </form>
  );
}

export default Search;
